    let aa = false


    function dropOpenToggel() {
        setDropOpen(!dropOpen)
    }

    function fun1(data1) {
        return (

            <div>

                {
                    data1.map(tree => fun2(tree))
                }
            </div>



        )
    }

    function fun2(data2) {
        return (
            // <li >
            <div style={{ paddingLeft: "20px" }} className={""} >
                <div className='row justify-content-center mt-n4 '>
                    <div className=' col-10'>
                        <Input type="text" defaultValue={data2.Name} ></Input>

                    </div>
                    <div className=' col-1 al-end'> <input type="checkBox" ></input></div>
                    <div className=' col-1 '>
                        <i className="mdi mdi-pencil font-size-12"
                            onClick={e => setMenu(data2.id)}
                        ></i>
                        <Dropdown isOpen={menu === data2.id} toggle={toggle} className="d-inline-block">
                            <DropdownToggle className="btn header-item " tag="button">

                            </DropdownToggle>
                            <DropdownMenu className="language-switch dropdown-menu-end">

                                <DropdownItem
                                    key={data2.id}
                                    onClick={() => addSub_PriceList(data2.id)}
                                // // className={`notify-item ${selectedLang === key ? "active" : "none"
                                //     }`}
                                >
                                    <span className="align-middle text-black">
                                        {"Add Sub-Rate"}
                                    </span>
                                </DropdownItem>

                                <DropdownItem
                                    key={data2.id}
                                    onClick={() => delete_PriceList(data2.id)}
                                // // className={`notify-item ${selectedLang === key ? "active" : "none"
                                //     }`}
                                >
                                    <span className="align-middle text-danger">
                                        {"Delete"}
                                    </span>
                                </DropdownItem>

                            </DropdownMenu>
                            <Input></Input>
                        </Dropdown>
                    </div>

                    {data2.childern ? fun1(data2.childern) : null}
                </div>
            </div>

        )

    }



    return (

        <div className={"mt-3"}>
            <Modal
                isOpen={dropOpen}
                toggle={() => { setDropOpen(!dropOpen) }}
                size="modal-fullscreen-xxl-down"
            >
                <div>
                    <Card>
                        <CardHeader>add sub PreceList</CardHeader>
                        <CardBody>
                        <Row className=' '>
                            <Input></Input>
                        </Row>

                        </CardBody>
                    </Card>
                    <Row className='px-md-4 pt-3 '>

                        <div className='row'>
                            <Label className='col col'>Category</Label>
                            {/* <p>jfhgv</p> */}
                            <div className='col'>
                                <Dropdown
                                    className="d-none d-lg-inline-block "
                                    isOpen={dropOpen}
                                    toggle={() => {
                                        // setsocialDrp(!socialDrp)
                                    }}
                                >
                                    <DropdownToggle
                                        className="btn header-item  text-danger"
                                        tag="button"
                                    >
                                        {/* <FeatherIcon
                                    icon="edit"
                                    className="icon-pencile"
                                /> */}

                                    </DropdownToggle>
                                    <DropdownMenu className="dropdown-menu-lg dropdown-menu-end"></DropdownMenu>
                                </Dropdown>
                            </div>
                        </div>

                    </Row>
                    <Row className='px-4'>
                    </Row>
                </div>

            </Modal>
            {fun1(data)}

        </div>


    )
}

